function Post({ key, title, description }) {
  return (
    <>
      {posts.map((post) => (
        <Card
          key={key}
          title={title}
          extra={<a href="#">More</a>}
          style={{ width: 300 }}
        >
          <p>{description}</p>
        </Card>
      ))}
    </>
  );
}

export default Post;
